// Cluster-Gruppe erstellen mit angepasstem Icon
var markers = L.markerClusterGroup({
  iconCreateFunction: function(cluster) {
    const count = cluster.getChildCount(); // Anzahl der Marker im Cluster
    return L.divIcon({
      html: `<div><span>${count}</span></div>`, // Markeranzahl anzeigen
      className: 'marker-cluster-large', // CSS-Klasse für große, runde Cluster
      iconSize: L.point(60, 60, true) // Große Cluster-Icon-Größe
    });
  }
});

// Marker-Einstellung
const customIcon = L.icon({
  iconSize: [60, 60],
  iconUrl: 'Marker01.png'
});





// Marker hinzufügen und Popup dynamisch erstellen
data.forEach(item => {
  const marker = L.marker([item.lat, item.lon], { icon: customIcon });
  const googleMapsUrl = `https://www.google.com/maps?q=${encodeURIComponent(item.fulladdr)}`;
  const popupContent = `
    <b>Name:</b> ${item.Name}<br>
    <b>Adresse:</b> ${item.fulladdr}<br>
    <b>Kategorie:</b> ${item.cat}
    <a href="${googleMapsUrl}" target="_blank" style="color: blue; text-decoration: underline;">Auf Google Maps ansehen</a>

  `;
  marker.bindPopup(popupContent); // Popup hinzufügen
  markers.addLayer(marker);      // Marker zur Cluster-Gruppe hinzufügen
});

// Cluster zur Karte hinzufügen
map.addLayer(markers);



// Geocoder hinzufügen (auf Deutschland beschränkt)
L.Control.geocoder({
      query: '', // Leeres Eingabefeld
      placeholder: 'Städte in Deutschland', // Platzhaltertext in der Suchleiste
      defaultMarkGeocode: false, // Kein Standard-Marker
      geocoder: new L.Control.Geocoder.Nominatim({
        geocodingQueryParams: { countrycodes: 'DE' } // Nur Deutschland
      })
    })
    .on('markgeocode', function(e) {
      // Ergebnis anzeigen
      var bbox = e.geocode.bbox; // Begrenzungsbox des Ergebnisses
      var bounds = L.latLngBounds(L.latLng(bbox.getSouthWest()), L.latLng(bbox.getNorthEast()));
      map.fitBounds(bounds); // Auf den Bereich zoomen
    })
    .addTo(map); // Geocoder als Control zur Karte hinzufügen

 